very low. I will remove themdf1=na.omit(df)","metadata":{}},{"cell_type":"code","source":"missing.values <- df %>%\n  gather(key = \"key\", value = \"val\") %>%\n  mutate(isna = is.na(val)) %>%\n  group_by(key) %>%\n  mutate(total = n()) %>%\n  group_by(key, total, isna) %>%\n  summarise(num.isna = n(), .groups = 'drop') %>%\n  mutate(pct = num.isna / total * 100) \n\nlevels =(missing.values  %>% filter(isna == T) %>% arrange(desc(pct)))$key\n\n\nd <- missing.values %>%\n     filter(key == levels)\n\npie_chart <- ggplot(data = d, aes(x = \"\", y = pct, fill = isna)) +\n  geom_bar(width = 1, stat = \"identity\") +\n  coord_polar(theta = \"y\") +\n  scale_fill_manual(values = c(\"#ffb997\", \"red\"), labels = c(\"Present\", \"Missing\")) +\n  labs(title = \"Percentage of missing values\", fill = \"\") +\n  geom_text(aes(label = paste(round(pct, 2), \"%\")), position = position_stack(vjust = 0.5)) +\n  my_theme()\n\npie_chart","metadata":{"_kg_hide-input":false,"_kg_hide-output":false,"execution":{"iopub.status.busy":"2023-03-20T14:46:50.340713Z","iopub.execute_input":"2023-03-20T14:46:50.342259Z","iopub.status.idle":"2023-03-20T14:46:51.245551Z"},"trusted":true},"execution_count":5,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeXxcVd0G8N85586evW3SjdICZRcBWZQXWbWioOwgiLyAIiiigGyKwMu+KLui\nyI4iAoWiyI4KCLS0QEv3LaRNm32ZJJPMes857x+TpJNJmnXm3pk7z/fjB5s7yzmZ3DvzzFmZ\n1poAAAAAIP9xuysAAAAAAJmBYAcAAADgEAh2AAAAAA6BYAcAAADgEAh2AAAAAA6BYAcAAADg\nEAh2AAAAAA6BYAcAAADgEAh2AAAAAA6BYAcAAADgEAh2AAAAAA6BYAcAAADgEAh2AAAAAA6B\nYAcAAADgEAh2AAAAAA6BYAcAAADgEAh2AAAAAA6BYAcAAADgEAh2AAAAAA6BYAcAAADgEAh2\nAAAAAA6BYAcAAADgEAh2AAAAAA6BYAcAAADgEAh2AAAAAA5hmJF6u+sAAAAAABlgaBm1uw4A\nAAAAkAHoigUAAABwCAQ7AAAAAIdAsAMAAABwCAQ7AAAAAIdAsAMAAABwCAQ7AAAAAIdAsAMA\nAABwCMPuCgBAHoh11P3t8bde/9eqlesbW4I92uWdMqWssrJi74O/8PWv7X/EobsUG8zuOqZ7\n/f6Hb/jTexubYnP23e9X9/70hL2K7a5Rr5ytWD46e+fTX26LDT6+63l3fHT3btbXB8B2LB6q\