       "},"metadata":{}}]},{"cell_type":"markdown","source":"<a id=\"3.2\"></a>\n### Data transformation\n\n Data transformation will begin the process of turning the data into the proper format(s)  data transformation will begin the process of turning the data into the proper format(s). \n \n Firstly, values in education and marital_state columns were categorised, In addition the age was found from the year of birth and categorised","metadata":{}},{"cell_type":"code","source":"# convert categorical variables to numerical values\ncustomer_data <- df %>% \n        mutate( Education = if_else(Education %in% c(\"2n Cycle\", \"Basic\", \"Graduation\"),\n                             \"Undergraduate\",\n                             \"Postgraduate\"),\n              Marital_Status = if_else(Marital_Status %in% c(\"Together\", \"Married\"),\n                             \"In relationship\",\n                             Marital_Status),\n               Marital_Status = if_else(Marital_Status %in% c(\"Alone\", \"Single\"),\n                             \"Single\",\n                             Marital_Status),\n              age = year(Sys.Date()) - Year_Birth)\ncustomer_data <- customer_data %>% \n  select(-ID, -Year_Birth, -Z_CostContact, -Z_Revenue, -Complain) %>%\n  subset( Marital_Status != \"YOLO\")%>%\n  mutate(age_group = cut(as.numeric(age), breaks = c(25, 35, 45, 55, 65, 75, Inf),\n                    labels = c(\"Under 35\", \"35-45\", \"46-55\", \"56-65\", \"66-75\", \"Over 75\")))\nhead(customer_data,4)","metadata":{"execution":{"iopub.status.busy":"2023-03-20T14:47:19.844527Z","iopub.execute_input":"2023-03-20T14:47:19.846228Z","iopub.status.idle":"2023-03-20T14:47:19.917741Z"},"trusted":true},"execution_count":10,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A data.frame: 4 Ã— 26</caption>\n<thead>\n\t<tr><th></th><th scope=col>Education</th><th scope=col>Marital_Status</th><th scope=col>Income</th><th scop