6-75    \n2 66-75    \n3 56-65    \n4 35-45    "},"metadata":{}}]},{"cell_type":"markdown","source":"<a id=\"3\"></a>\n# <p style=\"background-color:#0b032d;font-family:newtimeroman;color:#f4c095;font-size:150%;text-align:center;border-radius:10px 10px;\">Data Exploratory ðŸ›’</p>\n\nNow that we have preprocessed the data, we can start exploring it. We will start by examining the distributions of each variable to explore the data and gain a better understanding of customers' personality traits and their purchasing behavior.\n\n* Distribution of customers by age,  education level, and marital status\n","metadata":{"execution":{"iopub.status.busy":"2023-03-16T15:55:50.223291Z","iopub.execute_input":"2023-03-16T15:55:50.224849Z","iopub.status.idle":"2023-03-16T15:55:50.237138Z"}}},{"cell_type":"code","source":"#What is the average number of store purchases for customers who have a high income (Income > $100,000)?\nmean_store_purchases <- df %>%\n  filter(Income > 100000) %>%\n  summarise(mean_store_purchases = mean(NumStorePurchases))\n\n# print the result\ncat(\"The average number of store purchases for high income customers is\", round(mean_store_purchases$mean_store_purchases, 2))\n","metadata":{"execution":{"iopub.status.busy":"2023-03-20T14:47:21.524355Z","iopub.execute_input":"2023-03-20T14:47:21.527118Z","iopub.status.idle":"2023-03-20T14:47:21.559607Z"},"trusted":true},"execution_count":11,"outputs":[{"name":"stdout","text":"The average number of store purchases for high income customers is 4.23","output_type":"stream"}]},{"cell_type":"code","source":"#What is the correlation between income and the total amount spent on products (MntTotal)?\ncorrelation <- cor(df$Income, (df$MntWines + df$MntFruits + df$MntMeatProducts + df$MntFishProducts + df$MntSweetProducts + df$MntGoldProds))\n\n# print the result\ncat(\"The correlation between income and the total amount spent on products is\", round(correlation, 2))\n","metadata":{"execution":{"iopub.status.busy":"2023-03-20T14:47:22.49837Z","iopub.execute_input":"2023-03-20T14:47:22.501003Z","iopub.status.idle":"2023-03-20T14:47:22.53507Z"},"trusted":true},"execution_count":12,"outputs":[{"name":"stdout","text":"The correlation between income and the total amount spent on products is 0.67","output_type":"stream"}]},{"cell_type":"code","source":"library(grid)\nlibrary(\"gridExtra\")\n# Create a histogram of a numeric variable\noptions(repr.plot.width = 20, repr.plot.height = 9)\n\np1 <- ggplot(customer_data, aes(x = age)) +\n  geom_histogram(binwidth = 5, aes(fill = ..count..), color = \"#C8D5CD\", show.legend = FALSE) +\n  scale_fill_gradient(low = my_color, high = my_color[length(my_color)])+\n  #labs(title = \"Distribution of Age\") +\n  my_theme()\n\n\np2 <- ggplot(data=df, aes(x=Education)) +\n  geom_bar(binwidth = 5,  aes(fill = ..count..), color = \"#C8D5CD\", show.legend = FALSE) +\n  scale_fill_gradient(low = my_color, high = my_color[length(my_color)])+\n  labs( x=\"Education Level\", y=\"Count\",\n      ) +\n  my_theme()\n\np21 <- ggplot(data=customer_data, aes(x=Education)) +\n  geom_bar(binwidth = 5,  aes(fill = ..count..), color = \"#C8D5CD\", show.legend = FALSE) +\n  scale_fill_gradient(low = my_color, high = my_color[length(my_color)])+\n  labs( x=\"Education Level\", y=\"Count\",\n      ) +\n  my_theme()\n\np3 <- ggplot(data=df, aes(x=\"\", fill=Marital_Status)) +\n  geom_bar(width=1) +\n  scale_fill_manual(values=my_color)+\n  coord_polar(\"y\", start=0) +\n  labs( fill=\"Marital Status\"\n      #title=\"Marital Status of Customers\",\n      ) +\n  my_theme()\n\np31 <- ggplot(data=customer_data, aes(x=\"\", fill=Marital_Status)) +\n  geom_bar(width=1) +\n  scale_fill_manual(values=my_color[2:6])+\n  coord_polar(\"y\", start=0) +\n  labs( fill=\"Marital Status\"\n      #title=\"Marital Status of Customers\",\n      ) +\n  my_theme()\n\np4 <- ggplot(data=df, aes(y=Income)) +\n  geom_boxplot(col=my_color[5] ) +\n  labs( y=\"Income\"\n      #title=\"Distribution of Income\",\n      )+\n  my_theme()\n\np5 <- ggplot(data=df, aes(x=Recency)) +\n  geom_histogram(bins=10,  aes(fill = ..count..), color = \"#C8D5CD\", show.legend = FALSE) +\n  scale_fill_gradient(low = my_color, high = my_color[length(my_color)])+\n  labs( x=\"Recency\"\n      #title=\"Distribution of Recency\"\n      )+\n  my_theme()\n\n\np6 <- ggplot(data=df, aes(x=Income, y=MntWines+MntFruits+MntMeatProducts+MntFishProducts+MntSweetProducts+MntGoldProds)) +\n  geom_point(aes(color = MntWines+MntFruits+MntMeatProducts+MntFishProducts+MntSweetProducts+MntGoldProds), show.legend = FALSE) +\nscale_colour_gradient(name = \"Total Amount Spent\",low = my_color, high = my_color[length(my_color)])+\n  labs(x=\"Income\", y=\"Total Amount Spent\"      )+\n  my_theme()\n\ngrid.arrange(p1,p2,p21,p3,                                    \n             p4, p5,p6 , p31,                             \n             ncol = 4, nrow = 2, \n             layout_matrix = rbind(c(1,2,3,4), c(5,7,6,8)))+ my_theme()","metadata":{"execution":{"iopub.status.busy":"2023-03-20T14:47:22.815935Z","iopub.execute_input":"2023-03-20T14:47:22.817737Z","iopub.status.idle":"2023-03-20T14:47:25.458202Z"},"trusted":true},"execution_count":13,"outputs":[{"output_type":"display_data","data":{"text/plain":"NULL"},"metadata":{}},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAAQ4CAIAAAACJXBjAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeXxU1fnH8eece2dLJiGBEHYXUHGvWpe6VKu2Lq2t4lJbXCparbVarT8ttq6t\nWrVVW/cNUKtYt2rd16oVVxRFEUUBRSAQCGQISWa995zfHxNiCEtCMsNMks/71VcNd54595nJ\nJDOZ75xzVLpxrgAAAAAAAABAHxOIjix0CwAAFIYudAMAAAAAAAAAAAAANh4CQgAAAAAAAAAA\nAKAPISAEAAAAAAAAAAAA+hACQgAAAAAAAAAAAKAPISAEAAAAAAAAAAAA+hACQgAAAAAAAAAA\nAKAPKaKA0KRjf/zdrX99ftmal7x6z/2H7XXa8OpjttzurNMvfro2bTawAAAAAAAAAAAAAIBI\nUQWEj/72wtvufvHZ6SvbHX/i/PFHnvPo9FjpQUfuvcPAxEM3Tdhrvxsbfdv5AgAAAAAAAAAA\nAABZbqEbaLHo5bt/9eCiNY83zX/+lAlzyjbbf+rUswYHtYg8fO5Zv5r02tg7jnrqjBGdKSgU\nJ9hfxPrpWAF76ImUcp3IEBHxk0utSRW6nR5GB8qVDvmpukI30vO4J