ingle outlier that is affecting 2 graphs total amount spent \n6. on average between 10 to 80 days since customer's last purchase","metadata":{}},{"cell_type":"markdown","source":"<a id=\"3\"></a>\n# <p style=\"background-color:#0b032d;font-family:newtimeroman;color:#f4c095;font-size:150%;text-align:center;border-radius:10px 10px;\">Data Analysis ðŸ›’</p>\n\n<a id=\"5.1\"></a>\n## Demographic attributes\n\nTo provide insights into the composition and diversity of a dataset indiviuals, which can be useful in understanding patterns and trends in behavior, preferences, and needs. ","metadata":{}},{"cell_type":"code","source":"AgevMS <- customer_data %>%\n  filter(age<100) %>%\n  ggplot(aes(x = age, fill = Marital_Status)) +\n  geom_histogram(binwidth = 5, color = \"#C8D5CD\") +\n  scale_fill_manual(values = c(my_color[1:3],my_color[6:7])) +\n  labs(title = \" Correlation between Marital Status, \",\n       x = \"Age Groups\", y = \"Number of Customers\")+\n  my_theme()\n\nAgevEducation <- customer_data %>%  filter(age<100) %>%\n  ggplot(aes(x = age, fill = Education)) +\n  geom_histogram(binwidth = 5, color = \"#C8D5CD\") +\n  scale_fill_manual(values = c(my_color[2],my_color[7])) +\n  labs(title = \"Age & Education Distribution of Customers\",\n       x = \"Age Groups\", y = \"Number of Customers\")+\n  my_theme()\n\nplot <- grid.arrange(AgevMS,AgevEducation,                                    \n             ncol = 2, nrow = 1, \n             layout_matrix = rbind(c(1,2)))\n\n\nplot\n","metadata":{"execution":{"iopub.status.busy":"2023-03-20T14:52:36.005795Z","iopub.execute_input":"2023-03-20T14:52:36.007435Z","iopub.status.idle":"2023-03-20T14:52:36.915495Z"},"trusted":true},"execution_count":14,"outputs":[{"output_type":"display_data","data":{"text/plain":"TableGrob (1 x 2) \"arrange\": 2 grobs\n  z     cells    name           grob\n1 1 (1-1,1-1) arrange gtable[layout]\n2 2 (1-1,2-2) arrange gtable[layout]"},"metadata":{}},{"output_type":"display_data","data":{"image