%) and 481 (33.7%) customers respectively in relationships. The least populated age group is the absurd group (either under 18 or over 75) with only 1 customer each. The most common marital status is \"In relationship\" followed by \"Single\" and \"Divorced\n\n2.  It seems that the majority of customers fall into the age group of 35-55 years, with the highest number of customers having an undergraduate degree. Additionally, customers who are in the age group of 46-55 years seem to have the highest number of postgraduate degrees among all age groups.","metadata":{}},{"cell_type":"markdown","source":"<a id=\"5.2\"></a>\n## Purchasing behavior\nTo find the actions and patterns of customers when it comes to buying products or services.\n\n    Amount spent on different product categories in the last 2 years\n    Number of purchases made through different channels (website, catalog, store)\n    Visits to the company's website in the last month","metadata":{}},{"cell_type":"code","source":"T1 <- customer_data %>%\n  mutate(total_amount_spent = MntWines+MntFruits+MntMeatProducts+MntFishProducts+MntSweetProducts+MntGoldProds) %>%\n  filter(age<100)%>%\n  filter (Income < 3e+05)\n\n# Scatter plot colored by groups (\"Species\")\nsp <- ggscatter(T1, x = \"Income\", y = \"total_amount_spent\",\n                color = \"age_group\", palette = c(my_color[1:3],my_color[6:8]),\n                size = 3, alpha = 0.6)+\n  border()+ my_theme()\n                                         \n# Marginal density plot of x (top panel) and y (right panel)\nxplot <- ggdensity(T1, \"Income\", fill = \"age_group\",\n                   palette = c(my_color[1:3],my_color[6:8]))+ my_theme()\n\nyplot <- ggdensity(T1, \"total_amount_spent\", fill = \"age_group\", \n                   palette = c(my_color[1:3],my_color[6:8]))+\n  rotate()+ my_theme()\n\n# Cleaning the plots\nyplot <- yplot + clean_theme() \nxplot <- xplot + clean_theme()\n# Arranging the plot\nggarrange(xplot, NULL, sp, yplot, \n     