he following:**\n\n1. Customers who are Over 75 years old have the highest total amount spent on purchases with an average of 987.7273, while customers who are between 35-45 years old have the lowest total amount spent with an average of 504.9068.\n2. The Income of customers increases with age, with the highest average income observed among customers who are Over 75 years old with an average income of 64851.00, while customers who are Under 35 years old have the lowest average income of 49086.03.\n3. There seems to be a positive correlation between age and total amount spent on purchases, as the total amount spent increases with increasing age.\n4. However, it is also important to note that there could be other factors that influence the total amount spent, such as customer preferences, product availability, pricing strategies, and marketing efforts.\n\n","metadata":{}},{"cell_type":"code","source":"#options(repr.plot.width = 20, repr.plot.height = 9)\n\ndf_tidy <- customer_data %>% \n  gather(key = \"product\", value = \"amount\", MntWines:MntGoldProds)\n\n\ndf_Education <- df_tidy %>% \n  group_by(Education, product) %>% \n  summarize(total_amount = sum(amount)) %>%\n  ggplot( aes(x = total_amount, y = product, fill = Education)) +\n  geom_bar(stat = \"identity\", position = \"dodge\") +\n  scale_fill_manual(values = c(my_color[2],my_color[7])) +\n  labs(title = \"Most Popular Products Purchased by Education \\nLevel & Marital_Status Level\",\n       x = \"Total Amount Purchased\", y = \"Product\")+ my_theme()\n\n\ndf_Marital_Status <- df_tidy %>% \n  group_by(Marital_Status, product) %>% \n  summarize(total_amount = sum(amount)) %>%\n  ggplot( aes(x = total_amount, y = product, fill = Marital_Status)) +\n  geom_bar(stat = \"identity\", position = \"dodge\") +\n  scale_fill_manual(values = c(my_color[1:3],my_color[6:7])) +\n  labs( title=\"\", hjust = 0, x = \"Total Amount Purchased\", y = \"Product\")+ my_theme()\n\nplot <- grid.arrange(df_Education,df_Marital_Status,                                    \n              nrow = 1 )\n\n\nplot\n","metadata":{"execution":{"iopub.status.busy":"2023-03-20T14:52:54.362394Z","iopub.execute_input":"2023-03-20T14:52:54.363989Z","iopub.status.idle":"2023-03-20T14:52:55.279319Z"},"trusted":true},"execution_count":16,"outputs":[{"name":"stderr","text":"\u001b[1m\u001b[22m`summarise()` has grouped output by 'Education'. You can override using the\n`.groups` argument.\n\u001b[1m\u001b[22m`summarise()` has grouped output by 'Marital_Status'. You can override using\nthe `.groups` argument.\n","output_type":"stream"},{"output_type":"display_data","data":{"text/plain":"TableGrob (1 x 2) \"arrange\": 2 grobs\n  z     cells    name           grob\n1 1 (1-1,1-1) arrange gtable[layout]\n2 2 (1-1,2-2) arrange gtable[layout]"},"metadata":{}},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAAQ4CAIAAAACJXBjAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3yTxR/A8ctoumhpyyij7L2nKMoShB8CKiCIIKKggIiIIKBsGSKoDEFRQKYi\nMltBAQVlyAYBZbVsKFAK3btpmvz+KJbkSRrS5EnTms/75R/kcrm753nuucTn27tTaJOvCAAA\nAAAAAAAAAADuQenqBgAAAAAAAAAAAAAoOAQIAQAAAAAAAAAAADdCgBAAAAAAAAAAAABwIwQI\nAQAAAAAAAAAAADdCgBAAAAAAAAAAAABwIwQIAQAAAAAAAAAAADdCgBAAAAAAAAAAAABwI2pX\nNwBAETagWp9tsZnm6TUHzTk6r1bBtwcWNS7T80aG3jy9+SeLdg2rUPDtQZFTp3TPu1oLXYg7\n3ZgsN1rq7dCQeqstvrUw4sdXg73sb19RxiBmo50Ll01buv9ydGaVxk0mLHinez0/V7cIAAAA\nAAAUXgQI//sOvTGs6+aovN71Cmhy49pUjeLR5VwPm9Xk9WNWMoTf2xKs+Q/OSb25fXKjfmds\nyalQKDw8PQNLBVavVeXJNs1efKV1rRIaZzcPjuDiwgq6B5AX2++OvHgVbxB1Y4Zc7YEQ4tLy\nWX2nPPiddun40cEdrle+srixr8q1rQIAAAAAAIXWfzCcg3zJSDg17nCcDRn1U8f87fTWFHEG\ng0GbkREdGXVw96HPpix6stbAwTN+T9UbXN0uJ1pzZX18QtiVI0+4uiFOV6Qv7um7W+ITwv7+\noYGrG/KfVaS7hy0u3NviJne6I2S50XzL94hPCItPCPuyOnO/HmIQs8Xiz/4xfqnLiJ6yK8ZV\njQEAAAAAAIUfMwj/+55c/nX8ciGEuL5lUpNBZ80zhL7904LTA60XEnNq1dYYCytJFs4ZAL93\nG9TrgEnUc8w/P0ys6GNfaRW7zIhPEEKIlMiNFRqslby75sqG50potGmpV89cWL1w7Te/XMt9\nS69L3TR30cGj14/8NMhfZcMkTRQ4Lm6hJe9dbB+6B5AXW+6OvD6b168RSOR3GMw2+5sEw3/o\nzxQAAAAAAIDsmEHodhQK