3Y98leOt\nAQAAAACUOSXOhlTMc3hZOoVsmEFdsiEpJx4iGwIAqBH8ghAAQJ3wDaru+Hf38Y1De7WrUcHc\nQEeHb2Fdvl3PjutPrH+4Z5AxL8f9/VtsnDO+j52VqS7LY80rWRAR36D62Rcb3CY6Nqphri9g\n9YyNGrRuMXez2+u7MxwbDdw41t7SRMAyZFSuGJePhN3bGZMuJSKn5U0Kb9l8QbuMP3avCije\n2y5UsbZJwz9mPDr+R5/2tS2NdRniJBzHMGyH0SNv7+pRwiNi3q2tcIrqvIF1ozPPd25f2LdD\n00rmxro8XV1rW9u+I3+58GT77G5W8vWtWKWlY1Dl8JO/ty7q62hf3cJET4dlDYyN6jRpOGrm\nmLuvPf5om+NaY1ZgvvT0tmv7xgxyqm9jZSzg8YzNzJr95OC2Zb7f7Sn1DHI85d6icWfvNxsW\nOnduUqu8sQHPwMTYzqHFoh2rr2/qzFCOSgAAAAAAUGslzIakhHiIbJhBjbIhKSEeIhsCAKgR\nRiRUzJ21AQAA1IskNSnwY4RhlSo2Jur3e3q17jwAAAAAAEDZodbxSq07DwAApQsDhAAAAAAA\nAAAAAAAAAABaBLcYBQAAAAAAAAAAAAAAANAiGCAEAAAAAAAAAAAAAAAA0CIYIAQAAAAAAAAA\nAAAAAADQIhggBAAAAAAAAAAAAAAAANAiGCAEAAAAAAAAAAAAAAAA0CIYIAQAAAAAAAAAAAAA\nAADQIhggBAAAAAAAAAAAAAAAANAiGCAEAAAAAAAAAAAAAAAA0CIYIAQAAAAAAAAAAAAAAADQ\nIhggBAAAAAAAAAAAAAAAANAiGCAEAAAAAAAAAAAAAAAA0CIYIAQAAAAAAAAAAAAAAADQIhgg\nBAAAAAAAAAAAAAAAANAiGCAEAAAAAAAAAAAAAAAA0CL/B94m+nZtihecAAAAAElFTkSuQmCC\n"},"metadata":{"image/png":{"width":1200,"height":540}}}]},{"cell_type":"markdown","source":"**Based on the graph above, I can observe the following:**\n\n1. Customers with a Postgraduate education level spend less in total than customers with an Undergraduate education level, despite spending more on MntGoldProds and MntWines individually.\n2. Customers with an Undergraduate education level spend more in total than customers with a Postgraduate education level, and they spend the most on MntMeatProducts and MntWines individually.\n3. Both Postgraduate and Undergraduate customers seem to have a similar pattern of spending more on MntWines compared to the other products.\n4. Customers who are in a relationship have spent the most amount of money on all the listed products, followed by single customers, divorced customers, and then widowed customers.\n5. For all marital statuses, MntMeatProducts is the most popular product, followed by MntWines.\n6. Customers in a relationship have spent the most amount of money on MntMeatProducts and MntWines, while divorced customers have spent the most amount of money on MntGoldProds.\n\nOverall, the data suggests that customers who are in a relationship tend to spend more money on products, particularly on meat products and wines. However, the data does not indicate causality, and further analysis may be required to understand the factors that drive spending behavior among different marital statuses.","metadata":{}},{"cell_type":"code","source":"df_Education <- customer_data %>% \n  gather(key = \"Channel\", value = \"Purchases\", NumDealsPurchases, NumWebPurchases, NumCatalogPurchases, NumStorePurchases) %>% \n  mutate(Channel = case_when(\n    Channel == \"NumDealsPurchases\" ~ \"Deals\",\n    Channel == \"NumWebPurchases\" ~ \"Web\",\n    Channel == \"NumCatalogPurchases\" ~ \"Catalog\",\n    Channel == \"NumStorePurchases\" ~ \"Store\"\n  )) %>% \n  group_by(Education, Channel) %>% \n  summarize(Total_Purchases = sum(Purchases)) %>% \n  mutate(Percentage = Total_Purchases/sum(Total_Purchases)*100)%>%\n  ggplot(aes(Education,Percentage,fill=Channel))+\n  geom_bar(stat=\"identity\", color=\"black\", position=position_dodge(),width=0.65,size=0.3)+\n  coord_polar(theta = \"x\",start=0) +\n  ylim(c(-1,40))+ \n  scale_fill_manual(values = c(my_color[2],my_color[4],my_color[7],my_color[5])) +\n  my_theme()\n\ndf_Marital_Status <- customer_data %>% \n  gather(key = \"Channel\", value = \"Purchases\", NumDealsPurchases, NumWebPurchases, NumCatalogPurchases, NumStorePurchases) %>% \n  mutate(Channel = case_when(\n    Channel == \"NumDealsPurchases\" ~ \"Deals\",\n    Channel == \"NumWebPurchases\" ~ \"Web\",\n    Channel == \"NumCatalogPurchases\" ~ \"Catalog\",\n    Channel == \"NumStorePurchases\" ~ \"Store\"\n  )) %>% \n  group_by(Marital_Status, Channel) %>% \n  summarize(Total_Purchases = sum(Purchases)) %>% \n  mutate(Percentage = Total_Purchases/sum(Total_Purchases)*100)%>%\n  ggplot(aes(Marital_Status,Percentage,fill=Channel))+\n  geom_bar(stat=\"identity\", color=\"black\", position=position_dodge(),width=0.65,size=0.3)+\n  coord_polar(theta = \"x\",start=0) +\n  ylim(c(-1,40))+ \n  scale_fill_manual(values = c(my_color[2],my_color[4],my_color[7],my_color[5])) +\n  my_theme()\n\ndf_age <- customer_data %>% \n  gather(key = \"Channel\", value = \"Purchases\", NumDealsPurchases, NumWebPurchases, NumCatalogPurchases, NumStorePurchases) %>% \n  mutate(Channel = case_when(\n    Channel == \"NumDealsPurchases\" ~ \"Deals\",\n    Channel == \"NumWebPurchases\" ~ \"Web\",\n    Channel == \"NumCatalogPurchases\" ~ \"Catalog\",\n    Channel == \"NumStorePurchases\" ~ \"Store\"\n  )) %>% \n  group_by(age_group, Channel) %>% \n  summarize(Total_Purchases = sum(Purchases)) %>% \n  mutate(Percentage = Total_Purchases/sum(Total_Purchases)*100)%>%\n  ggplot(aes(age_group,Percentage,fill=Channel))+\n  geom_bar(stat=\"identity\", color=\"black\", position=position_dodge(),width=0.65,size=0.3)+\n  coord_polar(theta = \"x\",start=0) +\n  ylim(c(-1,40))+ \n  scale_fill_manual(values = c(my_color[2],my_color[4],my_color[7],my_color[5])) +\n  my_theme()\n\nplot <- grid.arrange(df_Education,df_Marital_Status,                                    \n              nrow = 1 )\n\n\nplot\ndf_age\n","metadata":{"execution":{"iopub.status.busy":"2023-03-20T14:53:14.946113Z","iopub.execute_input":"2023-03-20T14:53:14.947618Z","iopub.status.idle":"2023-03-20T14:53:16.732106Z"},"trusted":true},"execution_count":17,"outputs":[{"name":"stderr","text":"\u001b[1m\u001b[22m`summarise()` has grouped output by 'Education'. You can override using the\n`.groups` argument.\n\u001b[1m\u001b[22m`summarise()` has grouped output by 'Marital_Status'. You can override using\nthe `.groups` argument.\n\u001b[1m\u001b[22m`summarise()` has grouped output by 'age_group'. You can override using the\n`.groups` argument.\n","output_type":"stream"},{"output_type":"display_data","data":{"text/plain":"TableGrob (1 x 2) \"arrange\": 2 grobs\n  z     cells    n