on levels.\n4. The percentage of purchases made through Deals and Web channels increased with age, while the percentage of purchases made through the Store channel decreased with age.\n5.  Customers over 75 years old had a higher percentage of purchases through the Store channel compared to other channels, while customers under 35 had a higher percentage of purchases through the Web channel.\n6. The highest total purchases were made by the Undergraduate customers in the 46-55 age group through the Store channel.\n7. There is no significant difference in the percentage of purchases made by Postgraduate and Undergraduate customers in the 66-75 age group.\n8. The highest number of purchases was made by customers in a relationship across all channels.\n \n Overall, the data shows that customer purchase behavior is influenced by their age, education level, Marital_Status, and channel.","metadata":{}},{"cell_type":"code","source":"df_tidy <- customer_data %>%\n  filter(age<100) %>%\n  mutate(Dt_Customer = as.Date(Dt_Customer, \"%d-%m-%Y\")) %>%\n  filter(Dt_Customer >= max(Dt_Customer) - 60) %>%\n  group_by(Marital_Status, age) %>%\n  summarize(Total_Web_Visits = sum(NumWebVisitsMonth))\n\nggplot(df_tidy, aes(x = age, y = Total_Web_Visits, fill = Marital_Status)) +\n  geom_area() +\n  scale_fill_manual(values = my_color[3:7]) +\n  labs(x = \"Age\", y = \"Total Web Visits\", fill = \"Education\") +\n  my_theme()","metadata":{"execution":{"iopub.status.busy":"2023-03-20T14:56:00.585037Z","iopub.execute_input":"2023-03-20T14:56:00.586584Z","iopub.status.idle":"2023-03-20T14:56:01.203798Z"},"trusted":true},"execution_count":18,"outputs":[{"name":"stderr","text":"\u001b[1m\u001b[22m`summarise()` has grouped output by 'Marital_Status'. You can override using\nthe `.groups` argument.\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAAQ4CAIAAAACJXBjAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzde5BkCVYf5pNV1T3T0zO7MzuwZmHHuyKEAS