":{"image/png":{"width":1200,"height":540}}}]},{"cell_type":"markdown","source":" The data can be used to identify the most effective marketing campaign for each group. For example, for divorced postgraduate individuals, campaign 4 seems to be the most effective with a value of 7.87. However, for widow undergraduate individuals, campaign 4 is the least effective with a value of 9.75. Therefore, the data highlights the importance of considering the target audience and their characteristics when designing and implementing marketing campaigns.","metadata":{}},{"cell_type":"markdown","source":"<a id=\"6\"></a>\n# <p style=\"background-color:#0b032d;font-family:newtimeroman;color:#f4c095;font-size:150%;text-align:center;border-radius:10px 10px;\">Hypothesis Testing ðŸ›’</p>\n\n\n* Campaign4 has the highest acceptance rate, indicating that it may be the most effective campaign overall.\n* Married customers are more likely to make purchases than single customers. This can be due to the fact that married customers may have more stable financial situations and are more likely to purchase items for their family.\n* Customers in the middle-income range are more likely to make purchases than those with higher or lower incomes. This can be due to the fact that customers with lower incomes may not have the financial resources to make purchases, while customers with higher incomes may have other investments that they prioritize over making purchases.\n* The acceptance rates vary significantly across different target audiences, suggesting that targeted marketing may be more effective than a one-size-fits-all approach.","metadata":{}},{"cell_type":"markdown","source":"<a id=\"6\"></a>\n# <p style=\"background-color:#0b032d;font-family:newtimeroman;color:#f4c095;font-size:150%;text-align:center;border-radius:10px 10px;\">Conclusion ðŸ›’</p>\n\nIn conclusion, customer personality analysis is an important technique that can help marketing teams understand the behavior of their customers. By analyzing customer information such as age,  marital status, education, income, and purchase history, we were able to build hypothesis that can guide marketing strategies. In this notebook, we explored the distribution of customers by different characteristics and made four hypothesis that can be further tested and used to inform marketing decisions.\n\n**<span style=\"color:#0b032d;\"> If you liked this Notebook, please do upvote.</span>**\n\n","metadata":{}}]}